import Document, { Head, Main, NextScript, Html } from "next/document";

export default () => {
  return (
    <html>
      <Head>
        <style>{`body {background: #069}`}</style>
      </Head>
      <body>
        <Main />
        <NextScript />
      </body>
    </html>
  );
};
